var tipuesearch = {"pages": [{'title': 'About', 'text': '產品題目:自動磨豆機 \n 組員學號: \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 40823222( 倉儲 )、( 網站 ) \n \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 40823244( 倉儲 )、( 網站 ) \n', 'tags': '', 'url': 'About.html'}, {'title': '每周進度', 'text': '', 'tags': '', 'url': '每周進度.html'}, {'title': 'w1 小組討論', 'text': '題目:自動磨豆機 \n 動機:適合給予喜愛手沖咖啡的人。 \n 繪製組員:40823244 吳承翰 \n 程式模擬:40823222 曾喜賢 \n \n 3/11 零件圖檔 \n 自動磨豆機.zip \n 3/15 程式模擬 \n 模擬.ttt \n \n \n \n', 'tags': '', 'url': 'w1 小組討論.html'}, {'title': 'w2 繪製圖檔', 'text': '\n 自動咖啡磨豆機繪製圖： \n \n 各部零件圖: \n 錐刀組 \n \n \n 錐刀組與外殼 \n \n \n 旋轉軸 \n \n \n 錐型進豆槽與外殼 \n \n \n 分量撥粉器 \n \n \n 漏斗 \n \n \n 上蓋 \n \n \n 裝粉盒 \n \n \n 外殼 \n \n \n', 'tags': '', 'url': 'w2 繪製圖檔.html'}, {'title': 'w3 程式模擬', 'text': '\n 程式模擬過程 \n \n 第一次測試影片-無法正常運作 \n \n \n 修改後的模擬 \n \n 模擬圖:shell-外殼、Upper_cover-上蓋、Body-本體、Revolute_joint-旋轉街頭、axis-旋轉軸 \n \n \n 模擬圖:shell-外殼、Upper_cover-上蓋、Body-本體、Revolute_joint-旋轉街頭、axis-旋轉軸 \n \n 本體的動態特性 \n 把Body is respondable 打勾 \n \n 旋轉接頭的連結特性 \n 設立一個馬達\xa0 \n \n \n \n 剛體的動態特性 \n 為了使物體能夠有作動，所以將Body is dynamic 打勾 \n \n \n 完成圖 \n \n \n', 'tags': '', 'url': 'w3 程式模擬.html'}, {'title': 'w4 小組報告', 'text': '自動磨豆機.pdf \n \n \n', 'tags': '', 'url': 'w4 小組報告.html'}, {'title': '產品構想與介紹', 'text': '重要零件顯示以及介紹: \n 咖啡磨豆機的核心零件-研磨刀具。種類分為平刀、錐刀、鬼齒刀。 \n 下表為各刀具的比較 \n \n \n 而本次專題報告所使用的是錐刀。 \n \n \n 錐刀組所控制的是豆子磨出後粉粒的大小，而顆粒大小就是影響咖啡風味最決定性的因素，那本專題所控制的粉粒大小控制在1mm內。而模擬主要測試為顆粒是否可以過濾1mm以外的咖啡粉。 \n 旋轉軸與錐型進豆槽的配合： \n \n 咖啡豆的大小有許多的分級，下表為豆子的分級，那本專題所設計的磨豆機須讓8.2mm的豆子通過錐型進豆槽與旋轉軸配合的空間。使用模擬也會對這方面做測試。 \n \n \n 上蓋與漏斗的配合 \n \n', 'tags': '', 'url': '產品構想與介紹.html'}, {'title': '兩人小組心得', 'text': '', 'tags': '', 'url': '兩人小組心得.html'}, {'title': '40823222', 'text': '這次跟組員討論出來要做自動磨豆機，因為有時會品嘗咖啡的口感，所以聯想到要做個磨豆機，雖然與市面上的產品有所差異，但做出來還是有成就感，這次我的組員是負責繪圖，而我是使用程式模擬，一開始模擬時出現很多差錯，但經由慢慢摸索，也得到其他同學的協助，才能使程式可以運作出來，希望之後的四人小組、八人小組的也可以順順利利的完成', 'tags': '', 'url': '40823222.html'}, {'title': '40823244', 'text': '\xa0 這次兩人一組的專題，在經過多次的討論後，決定要做磨豆機，雖然東西可能看起來跟市面上的造型、功能上有些許差異，甚至離製作實體的路還有很長一段路，但從零到有一步一步把零件做出來，我覺得很開心，並且在組員的幫助下完成模擬，希望在未來不管是四人小組或是八人小組上都能順順利利。', 'tags': '', 'url': '40823244.html'}]};